description:
Cast: Keisha Grey, Karlee Grey, Dani Jensen, Xandra Sixx, Hollie Mack, Kimberly Brix, Alison Rey, Alex Chance

Description: Dr. Alex Chance is one sexy family therapist. This is a day in her life helping step-sisters with their relationships and finding out why she became a psychologist. We start off with a flashback to an awkward moment with her step-sister Alison telling Alex about her true feelings. The tender moments they shared led her to be the woman she is today. Her day starts with her first patient Xandra. A young girl who tells her about the sexual fantasies she's having about her step-sister. Then her next patient arrives, Dani. Her step-sister and her are not as close as they used to be and a sleepover at their parent's with a simple game of truth or dare is Dr. Chance's remedy. Her last patients of the day are two step-sisters, Keisha and Karlee who can not stop fighting because they were kicked out of a rave. Dr. Chance Gets hands on with some sexual exercises in closeness and by the end they are really enjoying each other. Dr. Alex Chance will do anything to help her patients.
